import React, { useState } from "react";
import { Form, Button, InputGroup } from "react-bootstrap";

export default function Login() {
  const [isLogin, setIsLogin] = useState(true); // default to login form
  const [showPassword, setShowPassword] = useState(false); // default to hide password
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handleToggle = () => {
    setIsLogin(!isLogin);
  };

  const handleShowPassword = () => {
    setShowPassword(!showPassword);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleConfirmPasswordChange = (event) => {
    setConfirmPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    if (isLogin) {
      // handle login
    } else {
      // handle signup
      if (password !== confirmPassword) {
        alert("Passwords do not match");
        return;
      }
    }
  };

  return (
    <div className="container mt-5">
      <h1>{isLogin ? "Login" : "Sign Up"}</h1>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formUsername">
          <Form.Label>Username or Email</Form.Label>
          <Form.Control type="text" placeholder="Enter username or email" />
        </Form.Group>
        <Form.Group controlId="formPassword">
          <Form.Label>Password</Form.Label>
          <InputGroup>
            <Form.Control
              type={showPassword ? "text" : "password"}
              placeholder="Password"
              value={password}
              onChange={handlePasswordChange}
            />
            <InputGroup.Append>
              <Button variant="outline-secondary" onClick={handleShowPassword}>
                {showPassword ? "Hide" : "Show"}
              </Button>
            </InputGroup.Append>
          </InputGroup>
        </Form.Group>
        {!isLogin && (
          <Form.Group controlId="formConfirmPassword">
            <Form.Label>Confirm Password</Form.Label>
            <Form.Control
              type="password"
              placeholder="Confirm Password"
              value={confirmPassword}
              onChange={handleConfirmPasswordChange}
            />
          </Form.Group>
        )}
        <Button variant="primary" type="submit">
          {isLogin ? "Login" : "Sign Up"}
        </Button>
      </Form>
      <p className="mt-3">
        {isLogin ? "Don't have an account?" : "Already have an account?"}{" "}
        <Button variant="link" onClick={handleToggle}>
          {isLogin ? "Sign up" : "Login"}
        </Button>
      </p>
    </div>
  );
}
